import React from 'react';
import Marker from '../images/marker.png';



export default function Entry(props){
    return(
        <>
        <div className="card mb-3 m-3"  >
  <div className="row g-0">
    {/* <div className="col-md-2 main-image-container">
      <img src={} className="img-fluid main-image" alt="..." />
    </div> */}
    <div className="col-md-8">
      <div className="card-body">


      {
        props.data.map((entry,index)=>{
          return(
            <div className="col-">
              <div className="location">
              <img src={Marker} alt="Marker" />
              <p>{props.entry.country}</p>
              <a href={props.entry.googleMapsLink} target='_blank' rel="noreferrer" >view on Google Maps</a>
              </div>
                      <h2 className="card-title">{props.entry.title}</h2>
                      <p className='trip-dates'>{props.entry.dates}</p>
                      <p className="card-text">{props.entry.text}</p>
            </div>
          )
        })
      }
      </div>
    </div>
  </div>
</div>
        </>
    )
}
